import React from "react";
import PropTypes from "prop-types";
import ListGroup from "react-bootstrap/ListGroup";

export default function DetailList({
    type,
})

{

    
    return (
        <ListGroup>
            <ListGroup.Item>
                <b>Type</b>: {type}
            </ListGroup.Item>

        </ListGroup>
    )
}

DetailList.propTypes = {
    type: PropTypes.string.isRequired,
};
